import { useEffect, useState } from "react";

function Store({ submissionComplete }) {
  const [stores, setStores] = useState([]);

  const fetchData = async () => {
    const token = localStorage.getItem('authToken');
    const response = await fetch("http://localhost:5281/api/Store{id}", {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    });

    setTasks(await response.json());
  }

  useEffect(() => {
    fetchData();
  }, []);

  useEffect(() => {
    fetchData();
  }, [submissionComplete]);

  return (
    <div>
      <ul>
        {stores?.map(store => (
          <li key={store.id}>{store.logo}</li>
        ))}
      </ul>
    </div>
  );
}

export default Store;
